import First from '../../assets/images/speimg1.jpg';
import Second from '../../assets/images/speimg2.jpg';
import Third from '../../assets/images/speimg3.jpg';

export default [
  {
    title: "Our Mission",
    description: "Our mission is provide students with SPE membership which gives them access to the technical and non-technical knowledge besides will keep them in touch with the prestigious, dynamic community of petroleum professionals worldwide and many other benefits",
    urls: First,
  },
  {
    title: "Who We Are",
    description: "The Society of Petroleum Engineers Khazar University Student Chapter recognizing that students of today are tomorrow’s professionals, has shown an interest in student members since its establishment on 1st of January in 2005.",
    urls: Second,
  },
  {
    title: "Third Slide",
    description: "This is the Third slider Image of our carousel",
    urls: Third,
  },
  {
    title: "Fourth Slide",
    description: "This is the Fourth slider Image of our carousel",
    urls: "https://mdbootstrap.com/img/Photos/Slides/img%20(133).jpg",
  },
  {
    title: "Fifth Slide",
    description: "This is the Fifth slider Image of our carousel",
    urls: "https://mdbootstrap.com/img/Photos/Slides/img%20(147).jpg",
  },
  {
    title: "Sixth Slide",
    description: "This is the Sixth slider Image of our carousel",
    urls: "https://mdbootstrap.com/img/Photos/Slides/img%20(105).jpg",
  },
  {
    title: "Seventh Slide",
